class Player(object):
    column_names = []
    players = {}

    def __init__(self, cells):
        self.stats = {}
        for i in range(0,len(cells)-1):
            self.stats[Player.column_names[i]] = cells[i].text
        Player.players[self.stats['Player']] = self
        if self.stats['Player'] == 'Player':
            pass
            #print(repr(cells))

    def clear():
        column_names = []
        players = {}

    def stat(self, key):
        try:
            return float(self.stats[key])
        except Exception:
            return 0.0

    def header_row(cells):
        for i in range(0,len(cells)-1):
            if not cells[i].text == Player.column_names[i]:
                return False
        return True

    def load(table):
        for row in table.findAll("tr"):
            cells = row.findAll("td")
            if not Player.column_names:
                for cell in cells:
                    Player.column_names.append(cell.text)
            elif not Player.header_row(cells):
                player=Player(cells)

    def get_stats(self, key):
        return "{0:<32}: {1:<4}".format(self.stats['Player'], self.stats[key])

    def print(field):
        for player in sorted(Player.players.values(), key=lambda x: x.stat(field), reverse=True):
            print(player.get_stats(field))

